function GetLandTransfer(n,t){var i=GetSearchParam(n,t);HttpPost(`/CurrentStatusOfHandedOverTakenOverLand/List`,"html",i,function(n){$("#divCurrentStatusOfLandTable").html("");$("#divCurrentStatusOfLandTable").html(n)})}function GetSearchParam(n,t){return{name:"test",pageSize:t,pageNumber:n}}function onPaging(n){GetLandTransfer(parseInt(n),currentPageSize);currentPageNumber=n}function onChangePageSize(n){GetLandTransfer(currentPageNumber,parseInt(n));currentPageSize=n}var currentPageNumber=1,currentPageSize=10;$(document).ready(function(){GetLandTransfer(currentPageNumber,currentPageSize)});